import React from 'react';
import styled from 'styled-components';

function Floating() {
  const FloatingStyle = styled.div`
    width: 70vh;
    height: 70vh;
    position: absolute;
    border-radius: 50%;
    margin-left: -37vh;
    margin-top: -37vh;
    background: linear-gradient(180deg, #71C9CE 0%, A6E3E9 100%);
    filter: blur(100px);
  `;

  return <FloatingStyle />;
}

export default Floating;
